ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Volkswagen Polo wyprodukowany w 2003 roku, który został wyposażony w silnik benzynowy o pojemności 1198 cm3, legitymujący się mocą 54 KM, który pokonał do tej pory 230000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Volkswagen prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Polo jest wyposażenia w:

- Klimatyzacje;

- Centralny zamek;

- Elektryczne szyby przednie;

- Alufelgi + komplet kół zimowych na stalówkach;

- Radio android;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 21.11.2025 roku.

Przegląd techniczny 22.07.2026 roku.
